        #region Deep Copy Fields From
        public void DeepCopyFieldsFrom(
            IModel item,
            IModelGetter rhs,
            ErrorMaskBuilder errorMask,
            TranslationCrystal copyMask)
        {
            if ((copyMask?.GetShouldTranslate((int)Model_FieldIndex.File) ?? true))
            {
                item.File = rhs.File;
            }
            if ((copyMask?.GetShouldTranslate((int)Model_FieldIndex.Data) ?? true))
            {
                errorMask?.PushIndex((int)Model_FieldIndex.Data);
                try
                {
                    if(rhs.Data_IsSet)
                    {
                        item.Data = rhs.Data.ToArray();
                    }
                    else
                    {
                        item.Data_Unset();
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if ((copyMask?.GetShouldTranslate((int)Model_FieldIndex.AlternateTextures) ?? true))
            {
                errorMask?.PushIndex((int)Model_FieldIndex.AlternateTextures);
                try
                {
                    if (rhs.AlternateTextures.HasBeenSet)
                    {
                        item.AlternateTextures.SetTo(
                            items: rhs.AlternateTextures,
                            converter: (r) =>
                            {
                                return r.DeepCopy(
                                    errorMask: errorMask,
                                    default(TranslationCrystal));
                            });
                    }
                    else
                    {
                        item.AlternateTextures.Unset();
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
        }
        
        #endregion
        
