            ret.AlternateTextures = new MaskItem<Exception, IEnumerable<MaskItem<Exception, AlternateTexture_ErrorMask>>>(this.AlternateTextures.Overall.Combine(rhs.AlternateTextures.Overall), new List<MaskItem<Exception, AlternateTexture_ErrorMask>>(this.AlternateTextures.Specific.And(rhs.AlternateTextures.Specific)));
